import React from "react";
import emoji from "./emojipedia"
import Entry from "./Entry";


function CreateEmoji(emoji){
  return(
    <Entry 
    emoji={emoji.emoji}
    name={emoji.name}
    meaning={emoji.meaning}

    />
  )
}
function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">
      {emoji.map(CreateEmoji)}

      </dl>
    </div>
  );
}

export default App;
